import React from 'react'
import { Link } from 'react-router-dom'

function Navigation() {
    return (
        <ul>
            <li>
                <Link to="/">Home</Link>
                <Link to="/my/cart">My Cart</Link>
            </li>
        </ul>
    )
}

export default Navigation
